const UserCard = ({user}) => {
  return (
    <div className="card" >
      <h1>{user.name}</h1>
      <span>{user.username}</span>
      <span>{user.phone}</span>
      <a>{user.website}</a>
      <span>{user.address.city}</span>
      <a href={user.path}> Перейти в профиль пользователя </a>
    </div>
  );
};

export default UserCard;
